webpackJsonp([0xd896d59bbbc1],{8583:function(e,n){e.exports={pathContext:{group:[{node:{fields:{title:"",date:"11 May 2004",slug:"/2004-05-11-muessen-nur-wollen/",tags:"Y2004"},html:'<p>This is a brilliant song, and perfectly sums up my mood at the moment. Imperfect translation is mine.<br />\n<!--more--><br />\n<em>Muß ich immer alles müssen was ich kann<br />\nEine Hand trägt die Welt und die andere bietet Getränke an<br />\nIch kann mit allen zehn Füßen in zwanzig Türen<br />\nUnd mit dem elften in der Nase noch Balette aufführen<br />\nAber wenn ich könnte wie ich wollte würde ich gar nichts wollen<br />\nIch weiß aber dass alle etwas wollen sollen</em></p>\n<p>Do I have to do everything that I can<br />\nOne hand holds the world, the other offers something to drink<br />\nWith all ten feet I can go through twenty doors<br />\nAnd the the eleventh I can perform ballet in my nose<br />\nBut if I could do what I wanted I wouldn\'t want anything<br />\nBut I know that everyone should want something</p>\n<p><em>Wir können alles schaffen genau wie die tollen<br />\nDressierten Affen wir <a href="http://www.wirsindhelden.com/html/wollen.html">müssen nur wollen</a><br />\nWir müssen nur wollen wir müssen nur wollen<br />\nWir müssen nur</em></p>\n<p>We can do everything, just like the heroes<br />\nTrained monkeys, we just have to want to<br />\nWe just have to want to, we just have to want to<br />\nWe just have to</p>\n<p><em>Muß ich immer alles müssen was ich kann<br />\nEine Hand in den Sternen, die andere im Hintern vom Vordermann<br />\nDas ist das Land der begrenzten Unmöglichkeiten<br />\nWir können Pferde ohne Beine rückwärts reiten<br />\nWir können alles was zu eng ist mit dem Schlagbohrer weiten<br />\nKönnen glücklich sein und trotzdem Konzerne leiten</em></p>\n<p>Do I have to do everything that I can<br />\nOne hand in the stars, the other in the behind of the man in front<br />\nThis is the land of limited impossibilites<br />\nWe can ride legless horses backwards<br />\nEverything that is too tight we can expand with a hammer drill<br />\nWe can be happy and still lead corporations</p>\n<p><em>Wir können alles schaffen genau wie die tollen<br />\nDressierten Affen wir müssen nur wollen<br />\nWir müssen nur wollen wir müssen nur wollen<br />\nWir müssen nur...</em></p>\n<p>We can do everything, just like the heroes<br />\nTrained monkeys, we just have to want to<br />\nWe just have to want to, we just have to want to<br />\nWe just have to...</p>\n<p>(Judith Holofernes, <a href="http://www.wirsindhelden.de">Wir Sind Helden</a>, (c) 2003)</p>'},next:{fields:{title:"Hymn Manual",date:"11 May 2004",slug:"/2004-05-11-hymn-manual/"}},previous:{fields:{title:"Phil Ringnalda",date:"11 May 2004",slug:"/2004-05-11-phil-ringnalda/"}}},{node:{fields:{title:"Hymn Manual",date:"11 May 2004",slug:"/2004-05-11-hymn-manual/",tags:"Y2004"},html:'<p><a title="Hymn Manual" href="http://hymn-project.org/docs/hymn-manual.html#faq-technical">Hymn Manual:</a> "Apple creates excellent products. OS X is the most usable commercial operating system I\'ve ever experienced. The iPod is great little device. The iTunes Music Store is a great way to buy music. Technologically speaking, I am enamored with almost everything they do. Ethically / legally speaking, however, they are (unfortunately) just as bad as most other big corporations."</p>'},next:{fields:{title:"Don Park's Daily Habit - Tortures for Dummies",date:"11 May 2004",slug:"/2004-05-11-don-parks-daily-habit-tortures-for-dummies/"}},previous:{fields:{title:"",date:"11 May 2004",slug:"/2004-05-11-muessen-nur-wollen/"}}},{node:{fields:{title:"Don Park's Daily Habit - Tortures for Dummies",date:"11 May 2004",slug:"/2004-05-11-don-parks-daily-habit-tortures-for-dummies/",tags:"Y2004"},html:'<p><a title="Don Park\'s Daily Habit - Tortures for Dummies" href="http://www.docuverse.com/blog/donpark/EntryViewPage.aspx?guid=6b12221b-9ef6-471c-9c06-672a4b18743a">Don Park:</a> "I am not saying (the soldiers accused of torture at Abu Ghraib) are all angels corrupted by evil interrogators.  What I am saying is that they are not too different from you and I.  The problem is not just them, but all of us."</p>'},next:{fields:{title:"Useless Spiegel",date:"10 May 2004",slug:"/2004-05-10-useless-spiegel/"}},previous:{fields:{title:"Hymn Manual",date:"11 May 2004",slug:"/2004-05-11-hymn-manual/"}}}],pathPrefix:"",first:!1,last:!1,index:489,pageCount:1101}}}});
